import { Box, SxProps, Theme, Button, TextField, Typography } from "@mui/material";
import { useEffect, VFC } from 'react'

const Sample: VFC = () => {
    const handleKeyDown = (event: KeyboardEvent) => {
        if (event.key === 'q') {
            var sound = new Audio("/resources/piano/c1.mp3");
            sound.play();
        }
    }

    useEffect(() => {
        document.addEventListener('keydown', handleKeyDown, false)
    }, [])

    return
}

export const Main = () => {
    return (
        <Box className="HeMainader" sx={sx}>
            <Sample></Sample>
        </Box>
    );
};

const sx: SxProps<Theme> = {
    "&.Main": {
        width: "100%",
    },
};
